function fetchAuthCode () {
  fetch('/auth', {
    method: 'GET',
    headers: {
      'Content-Type': 'text/html'
    }
  })
    .then(res => res.text())
    .then(res => (window.location.href = res))
}

function fetchTopItems () {
  fetch('/topItems', {
    method: 'GET',
    headers: {
      'Content-Type': 'application/json'
    }
  })
    .then(res => res.json())
    .then(res=> console.log(res))
}



export default {fetchTopItems, fetchAuthCode }
